//Filelist.js
import React from 'react';

const FileList = ({ files }) => {
  return (
    <div>
      <ul>
        {files.map((file, index) => (
          <li key={index}>{`${file.name} - uploaded on ${file.date}`}</li>
        ))}
      </ul>
    </div>
  );
};

export default FileList;
